{c_label}每秒攻擊次數：{c_number}{s1}{/c}{/c}
{icon:bullet} 以武器速度為基準。
{icon:bullet} 可透過技能和物品提高效果。

{c_label}爆擊機率：{c_number}{s1}{/c}{/c}
{icon:bullet} 爆擊可造成 {c_number}{s2}{/c} 的額外傷害。
{icon:bullet} 可透過技能和物品提高效果。

{c_label}盾牌格擋值：{c_number}{s1}{/c}{/c}
{icon:bullet} 當攻擊被格擋時所吸收的傷害量。
{icon:bullet} 盾牌格擋值可透過技能和物品提高效果。

{c_label}生命值上限：{c_number}{s2}{/c}{/c}
{icon:bullet} 失去所有生命值會死亡。 
{icon:bullet} 生命值可透過技能和物品提高效果。

{c_label}擊殺生命恢復：{c_number}{s1}{/c}{/c}
{icon:bullet} 每次擊殺敵人可恢復 {c_number}{s2}{/c} 點生命值。
{icon:bullet} 擊殺生命恢復可透過技能和物品提高效果。

{c_label}擊中生命恢復：{c_number}{s1}{/c}{/c}
{icon:bullet} 每次擊中敵人可恢復 {c_number}{s2}{/c} 點生命值。
{icon:bullet} 擊中生命恢復可透過技能和物品提高效果。

{c_label}爆擊傷害加成：{/c}{c_number}{s1}{/c}
{icon:bullet} 可透過技能和物品提高效果。
{icon:bullet} 對其他玩家的上限為 {c_number}{s2}{/c}。

{c_label}移動速度：{/c}{c_number}{s1}{/c}
{icon:bullet} 人物奔跑速度為基礎移動速度的 {c_number}{s2}{/c}。
{icon:bullet} 透過物品效果獲得的移動速度加成上限為 {c_number}+25.00%{/c}。

{c_label}經驗加成：{c_number}{s1}{/c}{/c}
{icon:bullet} 殺死怪物獲得的經驗值提高 {c_number}{s2}{/c}。
{icon:bullet} 經驗乘數：{c_number}{s3}x{/c}。此乘數適用於多人遊戲。

{c_label}荊棘傷害：{/c}{c_number}{s1}{/c}
{icon:bullet} 對直接擊中你的攻擊者造成傷害。持續傷害無法觸發此效果。
{icon:bullet} 主要屬性的部份數值會提供傷害加成。

{c_label}生命值上限：{c_number}{s2}{/c}{/c}
{icon:bullet} 若追隨者失去所有生命值即會暫時失去行動能力。
{icon:bullet} 生命值可透過技能和物品提高效果。

{c_label}生命值上限：{c_number}{s2}{/c}{/c}
{icon:bullet} 若追隨者失去所有生命值即會暫時失去行動能力。
{icon:bullet} 生命值可透過技能和物品提高效果。

{c_label}生命值上限：{c_number}{s2}{/c}{/c}
{icon:bullet} 若追隨者失去所有生命值即會暫時失去行動能力。
{icon:bullet} 生命值可透過技能和物品提高效果。

{c_label}範圍傷害：{/c}{c_number}{s1}{/c}
{icon:bullet} 所有攻擊均有 {c_number}{s2}{/c} 機率對 {c_number}{s4}{/c} 碼內的敵人造成 {c_number}{s3}{/c} 的額外傷害。
{icon:bullet} 可透過物品提高效果造成的傷害。

{c_label}{s1}傷害提高：{/c}{c_number}{s2}{/c}
{icon:bullet}使用此元素提高技能造成的傷害。
{icon:bullet} {s3}傷害：{c_number}{s4}{/c}。

{c_label}意志：{/c}{c_number}{s1}{/c}{c_lightgray}（物品加成：{c_blue}{s4}{/c}）{/c}{s2}
{icon:bullet} 治療接受效果提高 {c_number}{s3}{/c}
{icon:bullet} {c_important}{u}壓制{/u}{/c_important}傷害提高 {c_number}{s5}{/c}

{c_label}擊殺後獲得吸收傷害的屏障：{c_number}{s1}{/c}{/c}
{icon:bullet} 當你擊殺敵人時，可獲得一道吸收傷害的屏障。
{icon:bullet} 傷害吸收量可透過物品提高效果。

{c_label}藥水冷卻時間縮短：{c_number}{s1}{/c}{/c}
{icon:bullet} 縮短藥水的冷卻時間。
{icon:bullet} 可透過物品效果縮短。

{c_label}壓制機率：{/c}{c_number}{s1}{/c}
{icon:bullet} 壓制會依據你目前生命值與強韌生命值的總和而造成額外傷害。
{icon:bullet} 持續傷害、被動技能和引導技能無法造成壓制。
